function TodoRender(props) {
    const lista= props.lista
    if (props.lista == undefined){
        lista = this.props
    } 
    const push_render = lista.map((action) =>  <li>{action}</li> );

    return (
        <ul>{push_render}</ul>
    );
    
}
export default TodoRender;
